import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './CreateSalary.css';

const CreateSalary = ({ token, fetchSalaries }) => {
  const [newSalary, setNewSalary] = useState({
    employeeCode: '',
    employeeName: '',
    department: '',
    basicSalary: '',
    transportationAllowance: '',
    housingAllowance: '',
    mealAllowance: '',
    incentives: '',
    deductions: '',
    recordDate: '',
    notes: '',
    file: null,
  });
  const [netSalary, setNetSalary] = useState(0);
  const [errors, setErrors] = useState({});

  useEffect(() => {
    const calculateNetSalary = () => {
      const basic = parseFloat(newSalary.basicSalary) || 0;
      const transport = parseFloat(newSalary.transportationAllowance) || 0;
      const housing = parseFloat(newSalary.housingAllowance) || 0;
      const meal = parseFloat(newSalary.mealAllowance) || 0;
      const incentives = parseFloat(newSalary.incentives) || 0;
      const deductions = parseFloat(newSalary.deductions) || 0;
      const net = basic + transport + housing + meal + incentives - deductions;
      setNetSalary(net.toFixed(2));
    };
    calculateNetSalary();
  }, [newSalary]);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setNewSalary({
      ...newSalary,
      [name]: files ? files[0] : value,
    });
    setErrors({ ...errors, [name]: '' });
  };

  const validateForm = () => {
    const newErrors = {};
    if (!newSalary.employeeCode) newErrors.employeeCode = 'كود الموظف مطلوب';
    if (!newSalary.employeeName) newErrors.employeeName = 'اسم الموظف مطلوب';
    if (!newSalary.department) newErrors.department = 'القسم مطلوب';
    if (!newSalary.basicSalary) newErrors.basicSalary = 'الراتب الأساسي مطلوب';
    if (!newSalary.recordDate) newErrors.recordDate = 'التاريخ مطلوب';
    return newErrors;
  };

  const createSalary = async () => {
    try {
      const validationErrors = validateForm();
      if (Object.keys(validationErrors).length > 0) {
        setErrors(validationErrors);
        return;
      }
      const formData = new FormData();
      Object.keys(newSalary).forEach(key => {
        if (key === 'file' && newSalary.file) {
          formData.append('file', newSalary.file);
        } else {
          formData.append(key, newSalary[key]);
        }
      });
      await axios.post('http://54.227.197.41:5000/api/salaries', formData, {
        headers: {
          Authorization: `Bearer ${token}`,
          'Content-Type': 'multipart/form-data',
        },
      });
      alert('تم تسجيل المرتب بنجاح');
      setNewSalary({
        employeeCode: '',
        employeeName: '',
        department: '',
        basicSalary: '',
        transportationAllowance: '',
        housingAllowance: '',
        mealAllowance: '',
        incentives: '',
        deductions: '',
        recordDate: '',
        notes: '',
        file: null,
      });
      setErrors({});
      fetchSalaries();
    } catch (err) {
      console.error('خطأ في تسجيل المرتب:', err);
      alert('خطأ في تسجيل المرتب: ' + (err.response?.data?.message || err.message));
    }
  };

  return (
    <div className="create-salary">
      <h2>تسجيل مرتب</h2>
      <form className="salary-form" onSubmit={(e) => { e.preventDefault(); createSalary(); }}>
        <div className="form-group">
          <label htmlFor="employeeName">اسم الموظف</label>
          <input
            type="text"
            id="employeeName"
            name="employeeName"
            value={newSalary.employeeName}
            onChange={handleChange}
            placeholder="أدخل اسم الموظف"
            className={errors.employeeName ? 'error' : ''}
          />
          {errors.employeeName && <span className="error-message">{errors.employeeName}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="employeeCode">كود الموظف</label>
          <input
            type="text"
            id="employeeCode"
            name="employeeCode"
            value={newSalary.employeeCode}
            onChange={handleChange}
            placeholder="أدخل كود الموظف"
            className={errors.employeeCode ? 'error' : ''}
          />
          {errors.employeeCode && <span className="error-message">{errors.employeeCode}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="department">القسم أو الوظيفة</label>
          <input
            type="text"
            id="department"
            name="department"
            value={newSalary.department}
            onChange={handleChange}
            placeholder="أدخل القسم"
            className={errors.department ? 'error' : ''}
          />
          {errors.department && <span className="error-message">{errors.department}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="basicSalary">الراتب الأساسي</label>
          <input
            type="number"
            id="basicSalary"
            name="basicSalary"
            value={newSalary.basicSalary}
            onChange={handleChange}
            placeholder="أدخل الراتب الأساسي"
            className={errors.basicSalary ? 'error' : ''}
          />
          {errors.basicSalary && <span className="error-message">{errors.basicSalary}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="transportationAllowance">بدل انتقال</label>
          <input
            type="number"
            id="transportationAllowance"
            name="transportationAllowance"
            value={newSalary.transportationAllowance}
            onChange={handleChange}
            placeholder="أدخل بدل الانتقال (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="housingAllowance">بدل سكن</label>
          <input
            type="number"
            id="housingAllowance"
            name="housingAllowance"
            value={newSalary.housingAllowance}
            onChange={handleChange}
            placeholder="أدخل بدل السكن (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="mealAllowance">بدل وجبات</label>
          <input
            type="number"
            id="mealAllowance"
            name="mealAllowance"
            value={newSalary.mealAllowance}
            onChange={handleChange}
            placeholder="أدخل بدل الوجبات (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="incentives">حوافز</label>
          <input
            type="number"
            id="incentives"
            name="incentives"
            value={newSalary.incentives}
            onChange={handleChange}
            placeholder="أدخل الحوافز (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="deductions">خصومات</label>
          <input
            type="number"
            id="deductions"
            name="deductions"
            value={newSalary.deductions}
            onChange={handleChange}
            placeholder="أدخل الخصومات (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="recordDate">تاريخ التسجيل</label>
          <input
            type="date"
            id="recordDate"
            name="recordDate"
            value={newSalary.recordDate}
            onChange={handleChange}
            className={errors.recordDate ? 'error' : ''}
          />
          {errors.recordDate && <span className="error-message">{errors.recordDate}</span>}
        </div>
        <div className="form-group">
          <label htmlFor="notes">ملاحظات</label>
          <textarea
            id="notes"
            name="notes"
            value={newSalary.notes}
            onChange={handleChange}
            placeholder="أدخل ملاحظات (اختياري)"
          />
        </div>
        <div className="form-group">
          <label htmlFor="file">إرفاق ملف</label>
          <input
            type="file"
            id="file"
            name="file"
            onChange={handleChange}
          />
        </div>
        <div className="net-salary">
          <p>صافي المرتب: {netSalary} جنيه</p>
        </div>
        <button type="submit">تسجيل المرتب</button>
      </form>
    </div>
  );
};

export default CreateSalary;
